import React from 'react';
import { Navigate, Route, Routes } from 'react-router-dom';
import SearchHeader from '../components/shared/SearchHeader';
import MainLayout from '../Layout/MainLayout';

//Display
import nowplayingRoute from './routes-set/nowplaying';
import toprateRoute from './routes-set/toprate';
import detailRoute from './routes-set/detail';
import detailtoprateRoute from './routes-set/detailtoprate';

function MainRoutes(props) {
	const publicRouteMovie = [
		...nowplayingRoute,
		...toprateRoute,
		...detailRoute,
		...detailtoprateRoute,
	];

	return (
		<Routes>
			<Route path='/' element={<Navigate to='/now-playing' replace />} />
			{publicRouteMovie.map((r, idx) => (
				<Route
					key={idx}
					path={r.path}
					element={
						<MainLayout children={r.element} searchHeader={<SearchHeader />} />
					}
				/>
			))}
			{/* 
			<Route path='*' element={<BlankLayout />} /> */}
		</Routes>
	);
}

export default MainRoutes;
